    false,nt"url": null,nt"notes": "LIDAR-derived binary (.las) files containing
    points classified as bare-earth and canopy (first return) were produced for the
    2007/2008 Northwest Florida Water Management District - 5 Counties (Calhoun, Washington,
    Jackson, Liberty, Holmes), Florida lidar mapping project. ESRI GRIDs of bare earth
    points are also provided. The files were provided in a scheme of FDEM-derived 5,000
    x 5,000 foot (1500 x 1500 meter) tiles. Horizontal mapping units are in UTM meters,
    vertical mapping units are in U.S. survey feet. The total mapping area covers approximately
    2102 square miles.",nt"license_title": null,nt"extras": [{ntt"key":
